var title_f16_15_16626="Port placement left adrenalectomy";
var content_f16_15_16626=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F61077&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F61077&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 477px\">",
"   <div class=\"ttl\">",
"    Port placement left adrenalectomy*",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 457px; height: 587px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The peritoneal cavity is accessed with a Veres technique through a midclavicular, subcostal site. Three additional 5 mm ports are placed that include a flank port in the mid-axillary line between the subcostal margin and the iliac crest, an epigastric port and a medial subcostal port. Once the adrenal gland is resected, it is captured in a laparoscopic bag that is placed through the 12 mm subcostal port site and removed by extending this incision, as needed.",
"    <div class=\"footnotes\">",
"     * Port placement and technique may vary amongst laparoscopic surgeons.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
