"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?16/15/16632/contributors\">",
"     Bruce C Anderson, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?16/15/16632/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?16/15/16632/contributors\">",
"     Karl B Fields, MD",
"    </a>",
"    <br/>",
"   </div>",
