" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Choriocarcinoma histology",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 354px; height: 396px; background-image: url(data:image/jpeg;base64,);\">",
