var title_f16_15_16637="Dystonia PI";
var content_f16_15_16637=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F83212&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F83212&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Most common forms of dystonia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Early onset primary dystonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        When does it usually start?",
"       </td>",
"       <td>",
"        Childhood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Which muscles are affected most?",
"       </td>",
"       <td>",
"        Most of the time it starts in the leg, then moves to the trunk and other parts of the body",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        What else do I need to know about it?",
"       </td>",
"       <td>",
"        It often starts with mild symptoms that get worse as time goes on",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Cervical dystonia (also called spasmodic torticollis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        When does it usually start?",
"       </td>",
"       <td>",
"        Adulthood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Which muscles are affected most?",
"       </td>",
"       <td>",
"        Neck and shoulder muscles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        What else do I need to know about it?",
"       </td>",
"       <td>",
"        Some people also have a head tremor with cervical dystonia. About half the people with cervical dystonia have pain.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Blepharospasm",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        When does it usually start?",
"       </td>",
"       <td>",
"        Adulthood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Which muscles are affected most?",
"       </td>",
"       <td>",
"        Eyelid muscles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        What else do I need to know about it?",
"       </td>",
"       <td>",
"        Symptoms can include increased blinking and spasms that cause your eye to close. Both eyes are affected most of the time. Bright light or stress can make it worse. Most people do not have pain with blepharospasm.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Oromandibular and facial dystonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        When does it usually start?",
"       </td>",
"       <td>",
"        Adulthood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Which muscles are affected most?",
"       </td>",
"       <td>",
"        Face and throat muscles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        What else do I need to know about it?",
"       </td>",
"       <td>",
"        <p>",
"         Symptoms include problems with the jaw. For example, the jaw might clench, stay open, or be crooked. Some people cannot keep their tongue in their mouth. Some also have trouble speaking or swallowing.",
"        </p>",
"        <p>",
"         This type of dystonia often happens in people who also have blepharospasm or cervical dystonia",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Spasmodic dysphonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        When does it usually start?",
"       </td>",
"       <td>",
"        Adulthood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Which muscles are affected most?",
"       </td>",
"       <td>",
"        Muscles of the voice box (called the \"laryngeal muscles\")",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        What else do I need to know about it?",
"       </td>",
"       <td>",
"        Your voice might sound strained or you might only be able to whisper",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Arm dystonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        When does it usually start?",
"       </td>",
"       <td>",
"        Adulthood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Which muscles are affected most?",
"       </td>",
"       <td>",
"        Arm and hand muscles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        What else do I need to know about it?",
"       </td>",
"       <td>",
"        Arm dystonia can cause your hand or arm to stay in odd positions. In many people, symptoms happen only when the arm is stretched out and go away when the arm is at rest.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\">",
"        Occupational or task-specific dystonia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        When does it usually start?",
"       </td>",
"       <td>",
"        Adulthood",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Which muscles are affected most?",
"       </td>",
"       <td>",
"        This is a type of dystonia that happens only during certain activities. Writer's cramp is the most common form. Others include:",
"        <ul>",
"         <li>",
"          Typist's dystonia",
"         </li>",
"         <li>",
"          Golfer's dystonia",
"         </li>",
"         <li>",
"          Musician's dystonia",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        What else do I need to know about it?",
"       </td>",
"       <td>",
"        Symptoms happen only when the person tries to do a specific task such as write, swing a golf club, or play a musical instrument. The person has no symptoms when doing anything else.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
